import { useSelector } from 'react-redux';

const WinnerGraph = () => {
  const winners = useSelector(({ quiz }) => quiz.results).slice(0, 3);

  return (
    <div className="m-winner-graph">
      {winners.map(result => {
        return <p>{result.teamId} {result.score} {result.questionsCorrect}</p>
      })}
    </div>
  );
};

export default WinnerGraph;
